import BillBoardModel from "./billboard";
import PlaneModel from "./plane";
import SpriteModel from "./sprite";
var GeometryModels = {
  plane: PlaneModel,
  sprite: SpriteModel,
  billboard: BillBoardModel
};
export default GeometryModels;
